(3349, 'E324A', '5 LIRE AQUILOTTO ', '1927 - 1R', 'C/ Uno dei tre \"FERT\" in \"FEFERT\". Attualmente unico (?) esemplare conosciuto. Ciò è dovuto all’errata composizione della leggenda, da parte dell’operatore, in rilievo nella scanalatura dei cuscinetti nell’orlatrice lineare (o rettilinea)', 'ERRORI DI BATTITURA', 'ERRORI SUL CONTORNO', 'U', 'ATTARDI - GAUDENZI 20', '-', '-', '-', '-', '', 'VITTORIO EMANUELE III', 'Italy', '', '', '', '', '', ''),
(3350, 'E324B', '5 LIRE AQUILOTTO ', '1927', 'C/ Liscio; senza incisore in incuso del motto. Per il gioco che si viene a creare nella macchina orlettatrice lineare, la guida mobile, sottoposta a sollecitazione meccanica (allentandosi), si sposta orizzontalmente non comprimendo il tondello sui cuscinetti della guida fissa (recante le lettere, ed eventuali fregi, in rilievo, che compongono la leggenda da incidere sul contorno), lasciandolo scivolare via senza incisore. Argomento trattato nel Volume I, pag. 126-127, “Incisore del Motto Sabaudo”. Nomisma; asta n. 15, 8-9 aprile 2000, lotto n. 1646, conservazione FDC, aggiudicata per Lire 420.000 escluso diritti. Attualmente unico (?) Esemplare conosciuto', 'ERRORI DI BATTITURA', 'ERRORI SUL CONTORNO', 'U', 'ATTARDI - GAUDENZI 20', '-', '-', '-', '-', '', 'VITTORIO EMANUELE III', 'Italy', '', '', '', '', '', ''),
(3351, 'ESP324/1A', '5 LIRE AQUILOTTO ', '1927', 'Esperimento di rigatura del contorno. P 5,00 gr.  Diametro 22,80 mm.  Ag 835/1000. Pagani PP n. 232; Simonetti n. 100; Montenegro n. 219. Il Montenegro riporta:<<Per distinguere questa moneta da quelle da 50 Centesimi di nichelino; venne eseguito nel 1927 su di un pezzo normale da cinque lire>>. Quindi su una moneta destinata alla normale circolazione. Gigante 2010, nota pag. 146:<<Aggiudicato all’asta Sotheby’s del 22 aprile 2004 (tenutasi a Milano), in conservazione SPL (patinato), a 840 Euro più diritti>>. Quindi una moneta circolata. Perché si conosce un solo esemplare, finito sul mercato, se un pezzo doveva essere consegnato al “Re” e, a norma di legge, due al “Museo della Zecca”?', 'ESPERIMENTO', '', '(R4)', 'ATTARDI - GAUDENZI 20', '-', '-', '-', '-', '', 'VITTORIO EMANUELE III', 'Italy', '', '', '', '', '', ''),
