(4120, 'E62A', '10 CENTESIMI', '1894 BI', 'P 9,20 gr; diametro 30,00 mm; C/ Liscio. D/ Vittorio Emanuele II anziché Umberto I. L’esemplare, fatto controllare da diversi periti numismatici, appare autentico ed è molto circolato(conservazione MB). L’ipotesi più plausibile dell’origine di questo “ibrido” (ogni regola ha la sua eccezione) è che, presso la Zecca di Birmingham, siano stati accoppiati erroneamente un dritto di Vittorio Emanuele II ( che l’officina britannica aveva a disposizione, avendo coniato monete da 10 Centesimi per questo sovrano negli anni 1866 e 1867) con un rovescio millesimo per Umberto I. A sostegno di tale ipotesi vi è anche il S.d.z. utilizzato era stato la lettera “H”.', 'ERRORI DI BATTITURA', 'BATTITURA CON CONI ERRATI', 'R4', 'ATTARDI GAUDENZI 2008', '€ 150', '-', '-', '-', '', 'UMBERTO I ', 'Italy', '', '', '', '', '', ''),
