(6328, 'COPERTINA', '100 LIRE MINERVA II TIPO     ', '1990', 'D/ Si vedono sono la scritta “REPVBBLICA”, la testa senza orecchio e capelli, pomo d’Adamo ; R/ si vedono 3/4 di esergo compresa la data, la parte dell’ albero radicato al suolo, metà bastone appoggiato al suolo e il segno di zecca “R” (in corrispondenza dei rilievi impressi al dritto). L’ area non coniata della moneta è ricoperta da linee di metallo sovrapposte ed incrociate tra loro (segni impressi dal frammento di conio rotto trattenuto nell’ area di battitura al momento della coniazione - lato collo del conio) C/ rigato regolarmente con spessore 19,7 mm. sul lato posto nell’ area coniata e con spessore 18,2 mm. Sul lato posto nell’ area non coniata della moneta.                     ASSE 315°', 'ERRORI SUI CONI', 'Rottura marginale del conio con frammento trattenuto nell’ area di battitura                                             Coni mal posizionati', 'UNICO ESEMPLARE CONOSCIUTO', 'SENA 2020', '', '-', '-', '-', '-', 'REPUBBLICA ITALIANA', '', '', '', '', '', '', ''),
