(3193, 'E153A', '20 CENTESIMI LIBERTA’ LIBRATA ', '1908', 'Moneta battuta con conii collisi. Nello specifico, il conio di martello (Impronta B), non trovando il tondello nella ghiera (non si è posizionato, scivolando via), colpisce il corrispondente (conio d’incudine - Impronta A) ricevendone dei segni che rimarranno impressi sui successivi esemplari battuti da quel conio. La “collisione” dei conii, nelle vecchie presse, avveniva per l’errata taratura della parte mobile della pressa, recante il conio di martello; o al gioco che si veniva a creare in fase di coniazione. Oggi, nelle presse automatiche, un sistema di bloccaggio, calcolando anche lo spessore del tondello, impedisce di far scontare i due conii in mancanza del dischetto metallico.', 'ERRORI SUI CONI', 'CONI COLLISI', 'C', 'ATTARDI - GAUDENZI 20', '', '€ 1', '€ 5', '€ 45', '€ 200', 'VITTORIO EMANUELE III', '', '', ''),
