(3196, 'E162A', '20 CENTESIMI LIBERTA’ LIBRATA ', '1920', 'Coniazione a cappello; C/ Liscio anzichè rigato; Diametro 22,00 mm anzichè 21,50/21,70 mm; P 3,97 gr anziché 4,00 gr. Conservazione SPL (collezione privata). Con un tondello leggermente più grande (+0,5/0,3 mm), e non posizionatosi correttamente nella ghiera godronatrice “Rigata” (avente un diametro inferiore), per la pressione esercitata dal conio di martello (durante la battitura) avrebbe dovuto lasciare (nel taglio) una rigatura anche se irregolare (non continua o con la parte inferiore rigata e la parte superiore liscia); e non un contorno completamente liscio. Quindi è stata utilizzata una virola “Liscia” di diametro leggermente inferiore. “Errore Artefatto”.', 'ERRORI DI BATTITURA', 'BATTITURA DECENTRATA', '-', 'ATTARDI - GAUDENZI 20', '', '-', '-', '-', '-', 'VITTORIO EMANUELE III', '', '', ''),
