(3300, 'E109A', '2 LIRE        QUADRIGA BRIOSA ', '1914', 'C/ Uno dei tre “FERT” in “FKRT”. Difetto dovuto alla deformazione, consumazione o rottura delle lettere, in rilievo nella scanalatura dei cuscinetti, nell’orlettatrice rettilinea (vedi “incisione del motto Sabaudo” volume I, pag. 126-127). Il Dott. Gamberoni, nel segnalare tali esemplari, affermava che il valore era dieci volte maggiore rispetto a quelli normali (Gigante 2010, nota pag. 150).', 'ERRORI DI BATTITURA', 'ERRORI SUL CONTORNO', 'R', 'ATTARDI - GAUDENZI 20', '', '€ 25', '€ 50', '€ 100', '€ 250', 'VITTORIO EMANUELE III', '', '', ''),
