(3466, 'E237C', '5 CENTESIMI', '1862 N', 'D/ e R/ Impronte decentrate, dovute al tondello posizionatosi sopra la ghiera. Battuto per 3/4; doveva originariamente assumere una forma “a cappello” e raddrizzato successivamente (si deduce dal D/ dalla curvatura concava sopra la leggenda; e dal R/ dal sovrabbondo circolare sotto i rami di alloro e di quercia). Da non confondere con la moneta recante le impronte decentrate dovute ad una coniazione fuori virola (errore Artefatto). L’operatore anziché raddrizzare il tondello, doveva riporlo negli scarti di Zecca.', 'ERRORI DI BATTITURA', 'BATTITURA DECENTRATA', '-', 'ATTARDI - GAUDENZI 20', '', '-', '-', '-', '-', 'VITTORIO EMANUELE II(Regno)', '', '', ''),
