(3484, '', '10 CENTESIMI        II TIPO ', '1866 STRASBURGO', 'R/ = D/ Doppia testa. R/ Impronta più grande in incuso ed in posizione invertita. Il tondello è ovalizzato diametro circa 35,00 mm (coniato fuori virola). L’impronta è diversa; da notare le differenze del baffo, naso e specialmente l’orecchio. Considerata una “Prova” per il Marchisio nel 1904 /diametro 32,00 mm ). Lo stesso dicasi per il Montenegro, n. 116 (lamina Prova in Bronzo, diametro 30,00 mm). Non viene menzionata ne dal Pagani PP, ne dal Simonetti. Apparsa in alcune aste (Varesi n.5 del 1986 e Nomisma n. 3 del 1994), è stata definita con troppa superficialità una “PROVA”. Varesi nel dubbio, ha aggiunto un punto interrogativo (PROVA?).', 'ERRORI DI BATTITURA', 'BATTITURA CON CONI ERRATI', '-', 'ATTARDI - GAUDENZI 20', '', '-', '-', '-', '-', 'VITTORIO EMANUELE II(Regno)', '', '', ''),
