(3639, 'I604A', '50 CENT.', 'ITALIA  2002', 'Un operatore addetto alla pressa, di sua iniziativa, aumentava la taratura della macchina. Ciò provocava una maggiore pressione del conio, esercitata sul tondello, in fase di battitura. Con tale sistema coniava, volontariamente ed a colpo singolo, un tondello 50 CENT: Il risultato è stato eccellente, l’impronta è ben nitida ed ha un rilievo maggiore. I responsabili della Zecca, pur ammirando l’esemplare, sono stati contrari a proseguire in tal senso perchè sarebbero aumentati sia i tempi di coniazione che i costi di produzione.', 'VARIANTE', '', 'U', 'GAUDENZI ATTARDI 2005', '', '-', '-', '-', '-', 'UNIONE EUROPEA', '', '', ''),
